import React, { useState, useEffect } from "react";
import { ContextGlobalProvider } from "../ContextGlobal";
function DefaultPage(props) {
  if (props.statusCode) {
    return (
      <ContextGlobalProvider
        pageType={props.pageType}
        units={props.defaultProps.units}
        gradeGroups={props.defaultProps.gradeGroups}
        groups={props.defaultProps.groups}
        cookies={props.defaultProps.cookies}
      >
        <LayoutDefault>
          <Error statusCode={props.statusCode} />
        </LayoutDefault>
      </ContextGlobalProvider>
    );
  }

  return <ContextGlobalProvider pageType={props}></ContextGlobalProvider>;
}
